"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[5022],{40643:(e,a,o)=>{o.r(a),o.d(a,{default:()=>d});var i=o(53633);const r=[(0,i.Fv)('<h2 id="proyecto-de-agencia-creativa" tabindex="-1"><a class="header-anchor" href="#proyecto-de-agencia-creativa" aria-hidden="true">#</a> Proyecto de Agencia Creativa</h2><p>Los Proyectos de Agencia Creativa se utilizan para crear, implementar y gestionar estrategias y campañas de marketing para ayudar a otras empresas a promover sus productos o servicios. Estas agencias ofrecen una variedad de servicios, que pueden incluir marketing digital, publicidad, relaciones públicas, diseño gráfico, desarrollo de contenido, gestión de redes sociales, SEO (optimización de motores de búsqueda), SEM (marketing en motores de búsqueda) y análisis de datos. Su objetivo principal es aumentar la visibilidad, el alcance y las ventas de sus clientes a través de tácticas efectivas y personalizadas. Solop ERP contempla estos procesos, diseñando un circuito que se adapta a sus necesidades.</p><p>El Proyecto de Agencia Creativa será donde se deba ingresar todo pedido realizado por el cliente. Desde el Proyecto se vinculará todos los documentos que se haya generado a causa dicho Pedido a lo largo de toda la organización (Solicitudes, Orden de Compra, Orden de Venta, Cotizaciones, Tareas, etc) y será desde donde se defina la facturación a realizar.</p><p>Cada Proyecto de Agencia podrá tener un Brief, este será la descripción del servicio solicitado por el Cliente. Este se puede definir tanto en un Campo Texto o bien adjuntando un archivo directo en el Proyecto. Según el tamaño y complejidad del mismo, este podrá Fases, Tareas y Solicitudes vinculadas separando así el trabajo a realizar.</p><p>A su vez, directo desde un Proyecto se podrá generar las Órdenes de Venta definiendo lo que deberá facturar en relación al mismo.</p><p>Se deberán definir obligatoriamente en el cabezal los siguientes Campos:</p><p>Socio del Negocio Nombre Marca Categoría del Proyecto Nivel de línea Fecha Inicio (creación) Fecha Límite Lista de Precios</p><p>Campos Automáticos:</p><p>Según la Lista de precio seleccionada:</p><p>Moneda</p><p><img src="/assets/img/docs/project-management/prm-project1.png" alt="Proyecto de Agencia"></p><p>Según el Cliente seleccionado:</p><p>Término de pago. Almacén del Cliente: El almacén en un proyecto se definirá de manera automática según el almacén que tenga definido el Cliente en la pestaña Cliente ventana Socio del Negocio. Contrato de Servicio: (En caso que el Cliente posea más de uno, el sistema tomará el primer Contrato creado que encuentre, por lo que se sugiere en estos casos elegir el Contrato en este campo de forma manual). Sello. Sello Origen: Cuando se guarda un proyecto se realiza lo siguiente:</p><p>Según la Categoría de Proyecto se definirá el Sello Origen correspondiente que tenga definido el contrato en sus “Partes del Contrato”.</p><p>Según las siguientes Categoría de Proyecto se obtendrá el sello definido para el siguiente tipo de empresa:</p><p>Categoría de Proyecto</p><p>Tipo de Empresa</p><p>Proyecto de Agencia</p><p>Agencia Creativa</p><p>Proyecto de Medios</p><p>Agencia de Medios</p><p>Proyecto RRPP</p><p>Agencia RRPP</p><p>Proyecto de Medios Digitales</p><p>Agencia de Medios Digitales</p><div class="custom-container note"><p class="custom-container-title">Nota</p><p>Si no se obtuvo sello de origen se lanza una excepción.</p></div><p><img src="/assets/img/docs/project-management/prm-project2.png" alt="Partes del Contrato"></p><p>Según el usuario logueado en el sistema:</p><p>Agente Comercial: Este campo en el cabezal de un Proyecto tomará de forma automática al usuario logueado en el sistema siempre que este tenga el check de “Agente comercial” en “Y”, en la Pestaña “Empleado” de la ventana “Socio de negocio”.</p><h2 id="generacion-de-ordenes-de-trabajo" tabindex="-1"><a class="header-anchor" href="#generacion-de-ordenes-de-trabajo" aria-hidden="true">#</a> Generación de órdenes de trabajo</h2><p>Una orden de trabajo es considerado un Proyecto para Solop ERP. Se trata de una unidad de gestión que agrupa un conjunto de entidades que le dan forma y describen un determinado Servicio. Además, se trata de una dimensión contable, con el fin de poder obtener reportes financieros por Proyecto.</p><p>El primer paso para la creación de una Orden de trabajo es ingresar en la ventana el nombre del cliente (Socio del negocio del cual hereda la dirección y lista de precio), el campo Nombre (nombre de la campaña), fechas (opcionales), seleccionar una categoría de Proyecto, clase de Proyecto y una Descripción (o brief, dato manual opcional). Al grabado queda generado el registro de orden de trabajo (cabezal).</p><p><img src="/assets/img/docs/agency-management/agm-agency1.png" alt="Proyecto de Marketing"></p><h3 id="lineas-de-orden-de-trabajo" tabindex="-1"><a class="header-anchor" href="#lineas-de-orden-de-trabajo" aria-hidden="true">#</a> Líneas de Orden de Trabajo</h3><p>Una vez creado el cabezal de la orden de trabajo (Proyecto) el ejecutivo puede crear la/s líneas de la orden. Se trata de las tareas vinculadas al proyecto, o sea, los diferentes pedidos de un cliente para un determinado negocio. Este circuito se realiza en dos partes:</p><ul><li><p>Primero el ejecutivo carga en el campo descripción el pedido específico de la tarea. Ingresa el nombre de la tarea en el campo &quot;Material&quot;. Incorpora la cantidad, la unidad de duración (en general es &quot;Hora&quot;) y fecha prometida (opcional).</p></li><li><p>En un segundo paso el responsable de ejecutivos de cuentas (o quien cotiza) define el producto de las líneas. Cada producto posee un tarifario propio, el cual determina el precio del trabajo a realizar.</p></li></ul><p><img src="/assets/img/docs/agency-management/agm-agency2.png" alt="Línea de Proyecto"></p><h3 id="proceso-generar-orden" tabindex="-1"><a class="header-anchor" href="#proceso-generar-orden" aria-hidden="true">#</a> Proceso Generar Orden</h3><p>Cuando cada línea de orden de trabajo posee su producto definido (así como el resto de sus datos obligatorios) el responsable de ejecutivos de cuentas (o quien realiza cotización) corre el proceso &quot;Generar Orden&quot; desde el cabezal de la orden de trabajo definiendo en el campo Sub tipo ov = Propuesta, y en el campo Tipo de Documento = Cotización de Venta. Esto genera la orden de venta con la correspondiente cotización al cliente. Es posible imprimir/exportar para envío y aprobación por parte del contacto de nuestro cliente.</p><p><img src="/assets/img/docs/agency-management/agm-agency3.png" alt="Generar Orden"></p><h3 id="convertir-cotizacion" tabindex="-1"><a class="header-anchor" href="#convertir-cotizacion" aria-hidden="true">#</a> Convertir Cotización</h3><p>Cuando el cliente notifica la aprobación de la cotización enviada, desde el proceso de menú &quot;Convertir Cotización&quot; es posible generar la Orden de Venta firme (definitiva).</p><p>Esto realiza en automático la marca de Aprobación por cliente = SI en la Orden de trabajo vinculada, así como la creación de tantas tareas como líneas posea la orden de trabajo (genera solicitudes). También genera el cierre de la Orden de Venta Cotización.</p><p>Las tareas pueden visualizarse desde los documentos relacionados o solapa Solicitudes en la misma orden de trabajo.</p><p><img src="/assets/img/docs/agency-management/agm-agency4.png" alt="Generar Orden"></p><h3 id="asignacion-de-agentes-de-compania-a-las-diferentes-tareas" tabindex="-1"><a class="header-anchor" href="#asignacion-de-agentes-de-compania-a-las-diferentes-tareas" aria-hidden="true">#</a> Asignación de agentes de compañía a las diferentes tareas</h3><p>Una vez generadas las tareas por cada línea de orden de trabajo, el paso posterior es asignar recurso a cada una de estas tareas (diseñadores) con el fin de dar seguimiento al status de cada trabajo.</p><p>La gestión de carga de horas y estado de las tareas se realiza desde Solicitudes (Asunto) y una vez que todas las tareas vinculadas a una orden de trabajo se encuentran finalizadas, la misma podrá ser facturada a cliente.</p><p><img src="/assets/img/docs/agency-management/agm-agency5.png" alt="Generar Orden"></p><h3 id="crear-marcas-de-clientes" tabindex="-1"><a class="header-anchor" href="#crear-marcas-de-clientes" aria-hidden="true">#</a> Crear Marcas de Clientes</h3><p>Ventana: <strong>&quot;Campaña&quot;</strong></p><p>En la pestña de clientes se debe definir el cliente(s) para un correcto funcionamiento del link del campo, para que desde el Proyecto se muestren las marcas que posee cada cliente (una vez se defina el cliente en el proyecto).</p><p><img src="/assets/img/docs/agency-management/agm-agency6.png" alt="Generar Orden"></p><p><img src="/assets/img/docs/agency-management/agm-agency7.png" alt="Generar Orden"></p><h3 id="generar-orden-de-venta-desde-solicitud-de-cotizacion" tabindex="-1"><a class="header-anchor" href="#generar-orden-de-venta-desde-solicitud-de-cotizacion" aria-hidden="true">#</a> Generar Orden de Venta desde Solicitud de Cotización</h3><p>Una vez generada la Solicitud de Cotización (RFQ-Request for Quotation), evaluadas las respuestas, y aceptado una Respuesta de Cotización por el Cliente, se deberá proceder a generar una Orden de Venta al Cliente para que la misma se pueda aprobar mediante el flujo de aprobación estándar de la Orden de Venta.</p><p>La Orden de Venta se podrá generar directo desde la Solicitud de Cotización desde el botón “Crear Orden de Venta”.</p><p>Seleccione el Tipo de Orden de Venta “Orden de Venta con Aprobación”. Esta se generará con las líneas de la Solicitud de Cotización en cuestión, tomando la Respuesta de Cotización seleccionada como “Ganador Seleccionado” para definir los campos <em>Precio</em> según el definido en el campo “Precio Factura” y como “Socio del Negocio de Entrega Directa” al Proveedor de la misma.</p><p>Luego de generarla desde el proceso ubicado en el botón “Crear Orden de Venta”. Se podrá navegar a la misma desde el campo “Orden de Venta” existente al lado del botón.</p><p>Al Completar la Orden de Venta luego de la aprobación del Cliente, automáticamente se generará la Orden de Compra Enlazada según Entrega Directa.</p><h3 id="orden-de-venta-con-margen" tabindex="-1"><a class="header-anchor" href="#orden-de-venta-con-margen" aria-hidden="true">#</a> Orden de Venta con Margen</h3><p>En caso de contar con “% de Margen” (Mark-Up), el precio real enviado por la Cotización se definirá en la línea de la Orden de Compra. En caso de no existir “Mark-Up” los precios de la Orden de Venta y los precios de la Orden de Compra serán iguales.</p><h3 id="nivel-de-linea-proyecto-creativo-simple-primer-nivel" tabindex="-1"><a class="header-anchor" href="#nivel-de-linea-proyecto-creativo-simple-primer-nivel" aria-hidden="true">#</a> Nivel de Línea: Proyecto (Creativo Simple) / Primer Nivel</h3><p>El Nivel Proyecto se deberá utilizar cuando la Campaña o Trabajo (Job) a realizar es simple. Esto quiere decir que el Proyecto tendrá directamente los “To-Do” a realizar, sin contar con ningún nivel o agrupación intermedia.</p><ul><li>Proyecto <ul><li>“To-Do” (Solicitud)</li><li>“To-Do” (Solicitud)</li><li>“To-Do” (Solicitud)</li></ul></li></ul><h3 id="nivel-de-linea-fase-campana-multimedia-segundo-nivel" tabindex="-1"><a class="header-anchor" href="#nivel-de-linea-fase-campana-multimedia-segundo-nivel" aria-hidden="true">#</a> Nivel de Línea: Fase (Campaña Multimedia) / Segundo Nivel</h3><p>La Fase es el segundo nivel del Proyecto. Se deberá utilizar en los siguientes casos:</p><p>Cuando una Campaña cuente con diferentes “Materiales” se deberá definir el nivel de Fases con el fin de contar con una Fase por cada Material de la Campaña (Proyecto).</p><ul><li>Proyecto <ul><li>Material 1 (FASE) <ul><li>Solicitud (“To-Do”)</li><li>Solicitud (“To-Do”)</li><li>Solicitud (“To-Do”)</li></ul></li><li>Material 2 (FASE) <ul><li>Solicitud (“To-Do”)</li></ul></li></ul></li></ul><p><img src="/assets/img/docs/project-management/prm-project3.png" alt="Nivel Fase"></p><h3 id="nivel-de-linea-tarea-produccion-o-campana-multimedia-tercer-nivel" tabindex="-1"><a class="header-anchor" href="#nivel-de-linea-tarea-produccion-o-campana-multimedia-tercer-nivel" aria-hidden="true">#</a> Nivel de Línea: Tarea (Producción o Campaña Multimedia) / Tercer Nivel</h3><p>El Nivel de Proyecto hasta TAREA agrega un nivel adicional (3er Nivel) al Proyecto antes de llegar a la definición de Solicitudes (To-Do).</p><p>Este nivel se utilizará por ejemplo cuando existan Fases de Producción, donde se deba realizar Cotizaciones de Proveedores.</p><p>En este caso los niveles serán clasificados de la siguiente manera:</p><p>FASE: se clasificará el trabajo “Creativo” y “Producción” tendrá dentro las Solicitudes de Creatividad a realizar.</p><p>TAREAS: Dentro de cada Fase se crearán las diferentes TAREAS a realizar. En el caso de Producción, se deberá crear una Tarea por Cada Cotización a realizar.</p><ul><li>Proyecto (Tipo de Proyecto: Creativo) <ul><li>Material 1 (FASE) <ul><li>TAREA 1 <ul><li>Solicitud (“To-Do”)</li><li>Solicitud (“To-Do”)</li><li>Solicitud (“To-Do”)</li></ul></li><li>TAREA 2 <ul><li>Solicitud (“To-Do”)</li><li>Solicitud (“To-Do”)</li></ul></li></ul></li><li>Material 2 (FASE) <ul><li>TAREA 2 <ul><li>Solicitud (“To-Do”)</li><li>Solicitud (“To-Do”)</li></ul></li></ul></li></ul></li><li>Proyecto (Tipo de Proyecto: Cotización) <ul><li>Producción (FASE) <ul><li>TAREA 1 (Tema a Cotizar)</li><li>TAREA 2 (Tema a Cotizar)</li><li>TAREA 3 (Tema a Cotizar)</li></ul></li></ul></li></ul><h3 id="miembros-del-proyecto" tabindex="-1"><a class="header-anchor" href="#miembros-del-proyecto" aria-hidden="true">#</a> Miembros del Proyecto</h3><p>En cada Proyecto se podrá agregar Miembros. Los Miembros del Proyecto serán todos aquellos usuarios, internos como externos que estén involucrados con el Proyecto.</p><p>Estos pueden ser definidos manualmente desde el botón “Crear Desde” ubicado en el cabezal del Proyecto, como también automáticamente.</p><p>Al crearle un Proyecto a un Cliente, automáticamente se definirá como Miembros del Proyecto a todos los usuarios que que dicho Cliente tenga asignados a su Cuenta.</p><p>La asignación de Miembros de una Cuenta se definirá dentro de la Ventana <em>Socio del Negocio</em>, Pestaña <em>Miembros por Defecto</em>.</p><p>*Pestaña “Miembros por Defecto” en Ventana Socio del Negocio.</p><h3 id="solicitudes-del-proyecto" tabindex="-1"><a class="header-anchor" href="#solicitudes-del-proyecto" aria-hidden="true">#</a> Solicitudes del Proyecto</h3><p>Dentro de cada Proyecto se podrá crear diferentes Solicitudes asociadas al mismo. La ventaja de generar las Solicitudes desde un Proyecto, Fase o Tarea es que tomará del contexto toda la información que necesite, como Proyecto, Cliente, etc.</p><p>Desde la ventana Proyecto se podrá visualizar todas las Solicitudes relacionadas, tanto desde la Pestaña de Solicitudes correspondiente como desde la Barra de herramientas (Ver todas las solicitudes).</p><h2 id="proyecto-pestana-solicitudes-de-fase" tabindex="-1"><a class="header-anchor" href="#proyecto-pestana-solicitudes-de-fase" aria-hidden="true">#</a> Proyecto Pestaña Solicitudes de Fase</h2><h3 id="solicitud-to-do" tabindex="-1"><a class="header-anchor" href="#solicitud-to-do" aria-hidden="true">#</a> Solicitud (To-Do)</h3><p>Una Solicitud refiere a una Tarea específica (To-Do) que tiene determinado <em>Asunto</em>, <em>Descripción</em> y está <em>Asignado A</em> un Usuario con determinada <em>Fecha de Siguiente Acción</em> y <em>Fecha de Fin</em>.</p><p>Esta Solicitud a su vez, puede estar vinculada a diferentes documentos a lo largo del sistema, como por ejemplo un Proyecto, un Cliente, una Orden de Venta, una Factura, una Marca, un Sello, etc.</p><p>Dentro de una Solicitud se podrá agregar <em>Comentarios</em> y modificar el “<em>Asignado A”</em> o el <em>Estado</em> de la misma a medida que avanza el desarrollo de la misma. Cada Solicitud se podrá visualizar el histórico de Actualizaciones que la misma tuvo desde la pestaña de <em>“Actualizaciones”</em> detallando la Fecha-Hora, Usuario, Comentario así como demás cambios en los campos que fue realizando.</p><p>Cada Actualización que se realice sobre la Solicitud, el sistema estará enviando automáticamente notificaciones a cada usuario que esté vinculado a la misma. El tipo de Notificación a enviar dependerá de la Configuración de Notificaciones que cada usuario tenga definida (e-mail o aviso interno).</p><p>para ver más en detalle sobre las notificaciones ver “Notificaciones del Sistema”.</p><h3 id="tipo-de-proyecto" tabindex="-1"><a class="header-anchor" href="#tipo-de-proyecto" aria-hidden="true">#</a> Tipo de Proyecto</h3><p>El sistema brinda diferentes “Plantillas” donde se puede definir una estructura Tipo en la cual basarse para crear un Proyecto. Esta puede utilizarse o no, según desee el usuario. La principal ventaja sería la creación automática de Fases o Tareas según el Tipo de Proyecto seleccionado ahorrando a uno crearlas manualmente. Principalmente es útil para los Proyectos donde existan cotizaciones.</p><p>Dentro de los diferentes Tipos de proyecto encontramos:</p><ul><li><strong>Creativo:</strong> Estructura más simple, al seleccionarlo no se crean ninguna Fase ni Tarea por defecto. Simplemente define un conjunto de Estados de Proyecto así como también categoriza el proyecto en cuestión.</li><li><strong>Creativo + Cotización:</strong> Utilizado cuando existe Creatividad y Cotización. Crea una Fase para cada una. Se necesita nivel de Proyecto “Tarea”</li><li><strong>Cotización:</strong> Utilizado cuando es sólo para realizar una Cotización al Cliente. Crea una Fase de Cotización. Se necesita nivel de Proyecto “Tarea”</li></ul><h3 id="orden-de-venta-desde-proyecto" tabindex="-1"><a class="header-anchor" href="#orden-de-venta-desde-proyecto" aria-hidden="true">#</a> Orden de Venta desde Proyecto</h3><p>En cada Proyecto, cuando un trabajo deba ser facturado al Cliente, se deberá generar una Orden de Venta vinculada al mismo.</p><p>Para generar una Orden de Venta desde un Proyecto, se deberá definir en la Línea del Proyecto:</p><ul><li>el Producto/Servicio</li><li>el Precio</li><li>la Cantidad</li><li>una Descripción</li></ul><p>La ubicación de la Pestaña de “Línea” dependerá del <em>Nivel de Línea</em> seleccionado en el Proyecto, desplegando según corresponda Línea del Proyecto, Línea de la Fase o Línea de la Tarea.</p><p>Una vez definido el <em>Producto/Servicio</em> en la Línea que corresponda, se deberá generar una Orden de Venta desde el Botón “Generar Orden” ubicado en el Cabezal del Proyecto, en el Grupo de Campos “Acción”. La misma será generada tomando toda la información que se haya definido en las Líneas.</p><p>Las Órdenes de Venta generadas desde un Proyecto se pueden visualizar de diferentes maneras.</p><h3 id="vista-de-la-orden-de-venta-desde-la-pestana-del-proyecto" tabindex="-1"><a class="header-anchor" href="#vista-de-la-orden-de-venta-desde-la-pestana-del-proyecto" aria-hidden="true">#</a> Vista de la Orden de Venta desde la Pestaña del Proyecto</h3><p>Una opción es desde la pestaña de “Orden de Venta” def</p>',106)],n={},d=(0,o(89456).A)(n,[["render",function(e,a){return(0,i.uX)(),(0,i.CE)("div",null,r)}]])},29074:(e,a,o)=>{o.r(a),o.d(a,{data:()=>i});const i=JSON.parse('{"key":"v-add8c32e","path":"/docs/verticals/agency-management/service-project/creative-agency-project.html","title":"Proyecto de Agencia Creativa","lang":"es-ES","frontmatter":{"title":"Proyecto de Agencia Creativa","category":["Documentation"],"star":9,"sticky":9,"tag":["Agencia"],"article":false,"summary":"Proyecto de Agencia Creativa Los Proyectos de Agencia Creativa se utilizan para crear, implementar y gestionar estrategias y campañas de marketing para ayudar a otras empresas a pr","head":[["meta",{"property":"og:url","content":"https://ayuda.solopapp.com/docs/verticals/agency-management/service-project/creative-agency-project.html"}],["meta",{"property":"og:title","content":"Proyecto de Agencia Creativa"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2024-07-03T21:31:23.000Z"}],["meta",{"property":"og:locale","content":"es-ES"}],["meta",{"property":"article:tag","content":"Agencia"}],["meta",{"property":"article:modified_time","content":"2024-07-03T21:31:23.000Z"}]]},"excerpt":"","headers":[{"level":2,"title":"Proyecto de Agencia Creativa","slug":"proyecto-de-agencia-creativa","children":[]},{"level":2,"title":"Generación de órdenes de trabajo","slug":"generacion-de-ordenes-de-trabajo","children":[{"level":3,"title":"Líneas de Orden de Trabajo","slug":"lineas-de-orden-de-trabajo","children":[]},{"level":3,"title":"Proceso Generar Orden","slug":"proceso-generar-orden","children":[]},{"level":3,"title":"Convertir Cotización","slug":"convertir-cotizacion","children":[]},{"level":3,"title":"Asignación de agentes de compañía a las diferentes tareas","slug":"asignacion-de-agentes-de-compania-a-las-diferentes-tareas","children":[]},{"level":3,"title":"Crear Marcas de Clientes","slug":"crear-marcas-de-clientes","children":[]},{"level":3,"title":"Generar Orden de Venta desde Solicitud de Cotización","slug":"generar-orden-de-venta-desde-solicitud-de-cotizacion","children":[]},{"level":3,"title":"Orden de Venta con Margen","slug":"orden-de-venta-con-margen","children":[]},{"level":3,"title":"Nivel de Línea: Proyecto (Creativo Simple) / Primer Nivel","slug":"nivel-de-linea-proyecto-creativo-simple-primer-nivel","children":[]},{"level":3,"title":"Nivel de Línea: Fase (Campaña Multimedia) / Segundo Nivel","slug":"nivel-de-linea-fase-campana-multimedia-segundo-nivel","children":[]},{"level":3,"title":"Nivel de Línea: Tarea (Producción o Campaña Multimedia) / Tercer Nivel","slug":"nivel-de-linea-tarea-produccion-o-campana-multimedia-tercer-nivel","children":[]},{"level":3,"title":"Miembros del Proyecto","slug":"miembros-del-proyecto","children":[]},{"level":3,"title":"Solicitudes del Proyecto","slug":"solicitudes-del-proyecto","children":[]}]},{"level":2,"title":"Proyecto Pestaña Solicitudes de Fase","slug":"proyecto-pestana-solicitudes-de-fase","children":[{"level":3,"title":"Solicitud (To-Do)","slug":"solicitud-to-do","children":[]},{"level":3,"title":"Tipo de Proyecto","slug":"tipo-de-proyecto","children":[]},{"level":3,"title":"Orden de Venta desde Proyecto","slug":"orden-de-venta-desde-proyecto","children":[]},{"level":3,"title":"Vista de la Orden de Venta desde la Pestaña del Proyecto","slug":"vista-de-la-orden-de-venta-desde-la-pestana-del-proyecto","children":[]}]}],"git":{"createdTime":1706646436000,"updatedTime":1720042283000,"contributors":[{"name":"mgarciaQ76","email":"139590879+mgarciaQ76@users.noreply.github.com","commits":3}]},"readingTime":{"minutes":7.98,"words":2395},"filePathRelative":"docs/verticals/agency-management/service-project/creative-agency-project.md","localizedDate":"30 de enero de 2024"}')}}]);